mapper.select:

select 

from jvd_banushi_seiseki
where BANUSHI_CODE = #{banushiCode,jdbcType=CHAR}
  and SETTEI_NEN = #{setteiNen,jdbcType=DECIMAL}

mapper.delete:

delete from jvd_banushi_seiseki
where BANUSHI_CODE = #{banushiCode,jdbcType=CHAR}
  and SETTEI_NEN = #{setteiNen,jdbcType=DECIMAL}
